import React from "react";
import { v4 as uuidv4 } from "uuid";
import TimelineItem from "./TimelineItem";

export default function Timeline() {
  return (
    <div className="timeline clearfix">
      {JOBS.map((job) => (
        <TimelineItem key={uuidv4()} job={job} />
      ))}
    </div>
  );
}
